import axios from 'axios'
import React from 'react'
import styled from 'styled-components'
import { useState } from 'react'
import POcomponents from './POcomponents'

const BaseUrl = "https://delta-inspiration.herokuapp.com/api/previous-bookings/"
export default function PreviousOrder() {
    const [data, setdata] = useState()
    const fetchdata = ()=>{
        axios.get(BaseUrl,{
            headers:{
                "Authorization" : `Bearer ${localStorage.getItem('token')}`
            }
        }).then((res)=>{setdata(res.data)}).catch((err)=>{console.log(err)})
        // console.log(data,localStorage.getItem('token'))
        data.length();
    }
    fetchdata();
    return (
        <Container>
            { data && data.data.map((r)=>{
                 <POcomponents key={r.id} id={r.id}/>
                 console.log(r.id);
            })
        }
        </Container>
    )
}
// console.log(r)

const Container = styled.div`
    display: flex;
    width: 100vw;
    height: 100vh;
    background-color: red;

`;
